    static var globalUser = User()


     private init(){
        // this overrides the default init from Codable, which required a decoder
        self.name = ""
        self.username = ""
        self.profile_pic = ""
        self.profile_pic = ""
        self.accumulated_total_points = 0
        self.athletics_points = 0
        self.dining_points = 300
        self.netid = ""
        self.email = ""
        self.id = 0
        self.accumulated_athletics_points = 0
        self.accumulated_dining_points = 0
        self.rewards = [] // only change rewards in the web app
        self.bookmarkArray = defaults.array(forKey: "bookmarkEvent") as? [Int] ?? []
        self.favoriteArray = defaults.array(forKey: "bookmarkReward") as? [Int] ?? []
        self.adminEnabled = false
        self.primary_affiliation = "Student"
    }
    
    func flip(){
        adminEnabled = !adminEnabled!
        // lol finally got to see exclamation points on both sides
    }
    
    func setName(_ name: String){
        self.name = name
    }
    
    func setUsername(_ username: String){
        self.username = username
    }
    
     func setPic(profile_pic: String?){
        self.profile_pic = profile_pic
    }
    
     func addAthletic(points athletic_points: Int){
        self.athletics_points = self.athletics_points! + athletic_points
        self.accumulated_athletics_points = self.accumulated_athletics_points! + athletic_points
    }
    
     func addDining(points dining_points: Int){
        self.dining_points = self.dining_points! + dining_points
        self.accumulated_dining_points = self.accumulated_dining_points! + dining_points
    }
    
     func setNetid(netid: String?){
        self.netid = netid
    }
    
    func setEmail(_ email: String){
        self.email = email
    }
    
